import { BrowserRouter, Route, Switch } from "react-router-dom";
import About from "./components/about";
import Home from "./components/home";
import Topnav from "./components/topnav";


function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/">
          <Topnav/>
          <Home />
        </Route>
        <Route path="/about">
          <About />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
